ControlPropertyState.AutoRuleBindingString:
ClearCollect(
    colContactUsLinks,
    {
        title: LookUp(
            colTranslationTable,
            key = "contactus.burohelp.title" && language.Value = AppUserLang,
            text
        ),
        subtitle: LookUp(
            colTranslationTable,
            key = "contactus.burohelp.subtitle" && language.Value = AppUserLang,
            text
        ),
        icon: 'building (grey)',
        card_clickable: true,
        link: "mailto:ic.facilitiesmanagement-gestiondesinstallations.ic@canada.ca",
        main_phone: Blank(),
        toll_free_phone: Blank(),
        toll_free_title: Blank()
    },
    {
        title: LookUp(
            colTranslationTable,
            key = "contactus.techissues.title" && language.Value = AppUserLang,
            text
        ),
        subtitle: LookUp(
            colTranslationTable,
            key = "contactus.techissues.subtitle" && language.Value = AppUserLang,
            text
        ),
        icon: 'tools (grey)',
        card_clickable: false,
        link: "mailto:ic.itservicedesk-centredeservicesti.ic@canada.ca",
        main_phone: "613-946-5555",
        toll_free_phone: "1-866-929-3375",
        toll_free_title: LookUp(
            colTranslationTable,
            key = "contactus.techissues.tollfree" && language.Value = AppUserLang,
            text
        ) 
    },
    {
        title: LookUp(
            colTranslationTable,
            key = "contactus.iptechsupport.title" && language.Value = AppUserLang,
            text
        ),
        subtitle: LookUp(
            colTranslationTable,
            key = "contactus.iptechsupport.subtitle" && language.Value = AppUserLang,
            text
        ),
        icon: 'tech support (grey)',
        card_clickable: true,
        link: Switch(AppUserLang, "fr", "http://icweb.ic.gc.ca/eic/site/029.nsf/fra/00251.html", "http://icweb.ic.gc.ca/eic/site/029.nsf/eng/00251.html"),
        has_phone_link: false,
        main_phone: Blank(),
        toll_free_phone: Blank(),
        toll_free_title: Blank()
    }
);

Concurrent(
    //Finds the longest support title and is used to set the size of the gallery template height
    UpdateContext({_longestSupportTitle: 
        First(
            Sort(
                ForAll(
                    colContactUsLinks As Result,
                    {
                        Title: Result.title,
                        Len: Len(Result.title)
                    }
                ),
            Len,
            Descending
            )
        ).Title
    }),

    //Finds the longest seating type name and is used to set the size of the gallery template height
    UpdateContext({_longestSupportSubtitle: 
        First(
            Sort(
                ForAll(
                    colContactUsLinks As Result,
                    {
                        Title: Result.title,
                        Len: Len(Result.subtitle)
                    }
                ),
            Len,
            Descending
            )
        ).Title
    })
)
